import React from "react";
import './possibility.css';
import possibilityImage from '../../assets/possibility'

const Possibility = () => {
	return (
		<div className="omntech__possibility section__padding" id="possibility">
			<div className="omntech__possibility-image">
				<img src={possibilityImage} alt="possibility" />
			</div>
		</div>
	)
}

export default Possibility
